import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Signup from "./containers/Signup.js";
import Header from "./containers/Header.js";
import Logo from "./containers/Logo.js";
import Training from "./containers/Training.js"
import Mission from "./containers/Mission.js"
import Contact from "./containers/Contact.js"

class App extends Component {
  render() {
    return (
      <div>
        <Header />
        <div className="center">
          <Logo />
        </div>
        <Signup />
        <div className="putButtonInMiddle">
          <Training />
        </div>
        <div className="putInMiddle">
          <Mission text="Here is our mission statement"/>
        </div>
        <div className="putBlockInMiddle">
          <Mission text="user case"/>
        </div>
        <div className="putBlockInMiddle">
          <Mission text="Here is our mission statement"/>
        </div>
        <div>
          <Contact />
        </div>
      </div>
    );
  }
}

export default App;
